// Home.jsx
import React from 'react';
import {BrowserRouter as Router} from "react-router-dom";
import Header from "../Header/header";
import Footer from "../Footer/footer";

function Home() {
        return (
            <Router>
                <div>
                    <Header/>
                    <Footer/>
                </div>
                <div>
                    <h1>Home</h1>
                    <p>Welcome to our website</p>
                </div>
            </Router>
        )
}

export default Home;
